import React from "react";
export default function HomeLayout (){


return(

    <div className="mt-[62px] ml-[90px]">
    <div className="flex justify-between w-[1176px] h-[32px] g-[16px]" > 

    <div >
        <button className="text-[1] pt-[8px] pl[12px] pb-[8px] pr-[12px] bg-[#FFFFFF] g-[10px] h-[32px] w-[112px] rounded-sm" >All Cards</button>
        <button className="pt-[8px] pl[12px] pb-[8px] pr-[12px] bg-[#E4E4E4] g-[10px] h-[32px] w-[92px] rounded-sm" >Decks</button>
    </div>
    <p>SW-API Deck Builder</p>
    <p>Keanu Howe</p>

    </div>
    <hr className="w-[1176px] h-[2px] border-2 border-[#B8B8B8]"/>

    </div>


);



}
